import React, { useState } from "react";
import "../styles.css";
import { Link } from "react-router-dom";
import pic from "../images/wp4.jpg";

function Subscription() {
  const [selectedPlan, setSelectedPlan] = useState(null);

  return (
    <div
      style={{
        position: "relative",
        height: "100vh",
        width: "100vw",
        overflow: "hidden",
      }}
      onClick={() => setSelectedPlan(null)}
    >
      <div
        style={{
          content: "",
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          opacity: "66%",
          backgroundImage: `url(${pic})`,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          zIndex: -1,
        }}
      />
      <div style={{ margin: "24px", position: "relative" }}>
        <h1
          style={{
            color: "#004cff",
            fontSize: "150px",
            margin: 0,
            position: "absolute",
            top: "-50px",
            padding: 0,
          }}
        >
          인뱅
        </h1>
        <h2
          style={{
            color: "#004cff",
            position: "absolute",
            fontSize: "50px",
            top: "160px",
            left: "200px",
            transform: "rotate(-24deg)",
          }}
        >
          In-Bang
        </h2>
        <p style={{ color: "#ffffff" }}>
          <br />
          Choose your stated plan
        </p>
        <p style={{ color: "#ffffff", fontSize: "12px" }}>
          <br />
          /Ad free.
          <br />
          /Change or cancel plans anytime.
        </p>
        <table
          style={{
            backgroundColor: "#1200b8",
            color: "#ffffff",
            marginTop: "10px",
            marginLeft: "auto",
            marginRight: "auto",
          }}
        >
          <Link
            to="/"
            style={{
              position: "absolute",
              textDecoration: "none",
            }}
          >
            <button
              style={{
                backgroundColor: "#fc2003",
                color: "#000000",
                padding: "5px",
              }}
            >
              X
            </button>
          </Link>
          <tbody>
            <tr>
              <td style={{ padding: "20px", textAlign: "center" }}></td>
              <td style={{ padding: "20px", textAlign: "center" }}>
                <button
                  style={{
                    backgroundColor:
                      selectedPlan === "Standard" ? "#fc2003" : "transparent",
                    color: "#ffffff",
                    border: "none",
                    marginTop: "30px",
                  }}
                  onClick={(e) => {
                    e.stopPropagation();
                    setSelectedPlan("Standard");
                  }}
                >
                  Standard
                </button>
              </td>
              <td style={{ padding: "20px", textAlign: "center" }}>
                <button
                  style={{
                    backgroundColor:
                      selectedPlan === "Premium" ? "#fc2003" : "transparent",
                    color: "#ffffff",
                    border: "none",
                    marginTop: "30px",
                  }}
                  onClick={(e) => {
                    e.stopPropagation();
                    setSelectedPlan("Premium");
                  }}
                >
                  Premium
                </button>
              </td>
            </tr>
            <tr>
              <td style={{ padding: "20px", textAlign: "center" }}>
                Monthly Price
              </td>
              <td style={{ padding: "20px", textAlign: "center" }}>₱250</td>
              <td style={{ padding: "20px", textAlign: "center" }}>₱530</td>
            </tr>
            <tr>
              <td style={{ padding: "20px", textAlign: "center" }}>
                Video Quality
              </td>
              <td style={{ padding: "20px", textAlign: "center" }}>720p</td>
              <td style={{ padding: "20px", textAlign: "center" }}>4k + HDR</td>
            </tr>
          </tbody>
        </table>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "20px",
          }}
        >
          <Link to="/login">
            <button
              style={{
                backgroundColor: "#1200b8",
                color: "#ffffff",
                padding: "5px",
              }}
            >
              Next
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Subscription;
